INSERT INTO data_source_product_icons(data_source_product_id, contents) 
SELECT data_source_product_id, icons.contents FROM data_source_products as prods
JOIN
(VALUES ('postgresql',
bytea E'\\'
),
('mysql',
bytea E'\\'
),
('clickhouse',
bytea E'\\'
),
('bigquery',
bytea E'\\'
)) as icons(name, contents)
ON prods.product_root = icons.name
WHERE NOT EXISTS (SELECT data_source_product_id FROM data_source_product_icons)
;

